	(12, 1, '2022-12-13 09:52:25', '2022-12-13 08:52:25', '', 'Mariage', '', 'inherit', 'closed', 'closed', '', '11-revision-v1', '', '', '2022-12-13 09:52:25', '2022-12-13 08:52:25', '', 11, 'http://jmtriartstudiophoto.test/?p=12', 0, 'revision', '', 0),
	(13, 1, '2022-12-13 09:52:38', '2022-12-13 08:52:38', 'Poser devant l’objectif du photographe, habillé, en lingerie ou nu, pour se voir sous un angle différent et amorcer un processus de réconciliation avec son corps. Maladie, rupture, deuil ou prise de poids : les raisons poussant à faire une séance de photo-thérapie sont nombreuses. \r\nC’est pour apaiser ce mal-être que ce shooting existe. Je vous propose 3 séances différentes pour vous aidez à accepter votre corps et améliorer l’estime de soi, vous aidez à vous aimer telles que vous êtes et à prendre conscience que vous n’avez pas a vous cacher. “En se mettant au centre de l’image, vous vous mettrez au centre de votre vie.”\r\n<blockquote>\r\n<img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Phototherapie1-199x300.jpg" alt="Shooting phototherapie n°1" width="199" height="300" />\r\n<h3>Entretiens personnalisés</h3>\r\nUn ou plusieurs entretiens personnalisés aura lieu au Studio avant chaque séance.» Des entretiens qui permettent d’en savoir plus sur vos antécédents, de cerner vos besoins et de créer un climat de confiance.\r\nDes séances de débriefings sont aussi au programme lors de la remise des photos.\r\nC’est justement cet accompagnement personnalisé qui a séduit Sophie :\r\n”Aujourd’hui, grâce à cette première séance photo (qui fut suivie de d’autres pour le plaisir), je souris à mon reflet dans le miroir, j’ai retrouvé une approche positive à mon visage et à mon corps. Cette séance photo m’a beaucoup aidée à me sentir mieux.”, note la Laonnoise, âgée de 50 ans, qui a choisie l’option «RenEssence», à la suite d’une prise de poids, divorce et perte d’un être cher. \r\n\r\nUne expérience thérapeutique libératrice qui serait difficilement réalisable dans d’autres conditions selon elle.\r\n\r\n</blockquote>\r\n\r\n<h3>Séance «RenEssence».</h3>\r\nLa séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous !\r\n\r\n<h3>Séance «Sur les courbes de mon corps».</h3>\r\nLa séance intitulée «Sur les courbes de mon corps» se déroule au domicile de la personne photographiée ou au studio et se concentre sur les parties qui vous complexent.\r\n\r\n<h3>Séance «Sens-U-Elle».</h3>\r\nL’option «Sens-U-Elle» propose de faire la séance habillée ou en sous-vêtements en Studio, tout au long de la séance, dans une ambiance bienveillante et décontractée, vous serez guidée et accompagnée. A l\'aide de jeux de lumière et de la gestuelle, je mets en avant votre personnalité, mon objectif est de sublimer votre beauté, tout en gardant votre naturel. Quand on est habillé, on se compare à un idéal de beauté et donc aux autres, du coup, on se concentre beaucoup plus sur un bourrelet, un ventre qui ressort dans une robe moulante, par exemple. Et puis, en sous-vêtements, on ne peut plus se cacher, on est vraiment soi !. Pour autant, se faire photographier en sous-vêtements, n’est pas facile pour tout le monde, cela s\'adresse davantage aux femmes qui, malgré leurs complexes, ont un minimum de confiance en elles, et généralement choisissent le plus souvent cette séance aprés les 2 autres précédemment citées. \r\n\r\n<div class="bouton">\r\n<div><a href="#">Carte Cadeau</a></div>\r\n<div><a href="#">Tarifs</a></div>\r\n<div><a href="#">En savoir +</a></div>\r\n</div>\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Photo-thérapie', '', 'publish', 'closed', 'closed', '', 'bapteme', '', '', '2022-12-16 14:27:27', '2022-12-16 13:27:27', '', 0, 'http://jmtriartstudiophoto.test/?page_id=13', 0, 'page', '', 0),
	(14, 1, '2022-12-13 09:52:38', '2022-12-13 08:52:38', '', 'Baptême', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2022-12-13 09:52:38', '2022-12-13 08:52:38', '', 13, 'http://jmtriartstudiophoto.test/?p=14', 0, 'revision', '', 0),
	(15, 1, '2022-12-13 09:52:50', '2022-12-13 08:52:50', '<h4 class="titre_prestation">GROSSESSE</h4>\r\n<h5 class="soustitre_prestation">Je suis à chaque fois très touchée\r\nqu’une future maman m’accorde sa confiance</h5>\r\n<article>\r\n<div class="paragraphe_FG">\r\n\r\n<span class="Lettrine">C</span>a y est la bonne nouvelle est arrivée, vous allez devenir bientôt maman.\r\nVous allez au fil des mois, commencer à sentir ce petit être grandir dans votre ventre, vous allez le câliner, lui parler, le rassurer et l’aimer un peu plus chaque jours jusqu’à enfin pouvoir le/la tenir dans vos bras et l’admirer\r\nOffrez-vous une jolie séance photo Grossesse pour immortaliser votre ventre tout rond.\r\nUne séance photo Maternité, c’est se souvenir de ses jolies formes.\r\n\r\n</div>\r\n</article><article>\r\n<div class="imageFlottanteDroite"><img class="shootGross1 size-medium wp-image-120" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/grossesse01-300x225.jpg" alt="Shooting grossesse n°1" width="300" height="225" /></div>\r\n<div class="paragraphe_FG">\r\n<h3>Qui a t’il de plus beau que donner la vie</h3>\r\nImmortaliser ce moment si important dans votre vie à vous mais aussi de votre couple.\r\nOffrez vous et offrez lui, de magnifiques souvenirs avant sa naissance, que vous pourrez revivre ensemble quand il/elle sera plus grand(e).\r\n<div class="imageFlottanteGauche"><img class="shootGross2 size-medium wp-image-121" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/grossesse02-300x219.jpg" alt="Shooting grossesse n°2" width="300" height="219" /></div>\r\n<div class="paragraphe_FG">\r\n<h3>Une séance photo toute seule, en couple, avec toute la famille</h3>\r\nDurant la séance photo, je fais des photos avec votre compagnon, un petit moment dans votre petite bulle d’amour\r\noù vous profiter de vous retrouver, de vous regarder, de vous dire des mots tout mignon, de vous serrer dans les bras …\r\nJe ferai également des photos de vous toute seule ainsi que des photos de la fratries s’il y a des frères et soeurs.\r\n<h3>Vivez une expérience unique</h3>\r\nLa maternité est une expérience extra-ordinaire… Neuf mois d’attente qu’il est important d’immortaliser dans le\r\nmoindre détail. De la chambre du bébé à votre main posée délicatement sur votre ventre rond, gardez un souvenir\r\nprécieux de cette aventure éphémère avant que bébé ne vienne chambouler votre vie.\r\n\r\nLe reportage maternité peut se dérouler chez vous, ou en extérieur si le temps le permet.\r\n\r\nGardez également de belles images des premiers instants de vie de votre bébé aux creux de vos bras et dans son nouveau cocon.\r\n\r\n</div>\r\n<div class="boutons"><a href="#">Tarifs</a></div>\r\n<div class="boutons"><a href="#">Carte Cadeau</a></div>\r\n<div class="boutons"><a href="#">En savoir +</a></div>\r\n</div>\r\n\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />\r\n\r\n</div>\r\n</article>', 'Grossesse', '', 'trash', 'closed', 'closed', '', 'grossesse__trashed', '', '', '2022-12-16 10:56:42', '2022-12-16 09:56:42', '', 0, 'http://jmtriartstudiophoto.test/?page_id=15', 0, 'page', '', 0),
