	(24, 1, '2022-12-13 10:15:56', '2022-12-13 09:15:56', '<h1>Mon expérience au service de vos projets et de vos souvenirs.</h1>\r\n<h2>Une petite présentation du photographe</h2>\r\nJe m’appelle Jean-Michel et je suis né en 1967 à Saint-Germain-en-Laye (78).\r\nj\'aime saisir les instants de vie, les instants d\'émotion\r\net l\'opportunité graphique tant en photos de rue qu\'en studio,\r\nje ne photographie pas avec des lumières...\r\n...je la sculpte !.\r\n\r\nC’est en 1982 que je fais l’acquisition de mon premier appareil\r\nphoto argentique offert par mon père à qui je dois mon amour pour la photo...', 'Accueil', '', 'inherit', 'closed', 'closed', '', '5-revision-v1', '', '', '2022-12-13 10:15:56', '2022-12-13 09:15:56', '', 5, 'http://jmtriartstudiophoto.test/?p=24', 0, 'revision', '', 0),
