	(84, 1, '2022-12-13 13:47:36', '2022-12-13 12:47:36', '<h4 class="fond">BAPTEME</h4>\r\n<h5 class="fond">Une étape marquante dans la vie\r\nde votre enfant et dans l’histoire\r\nde votre famille</h5>\r\n<span class="Lettrine">A</span>u-delà des moments clés du baptême, ce qui fait que mon style est unique c’est ma facilité à capturer des moments de vie\r\nspontanés grâce à ma discrétion : La joie des retrouvailles, l’émotion d’un geste tendre, la beauté d’un détail, les enfants\r\nqui jouent… Je sais aussi qu’organiser un baptême est le moment idéal pour réunir toute votre famille et les personnes qui vous\r\nsont chères. Je fais donc en sorte que vous passiez un très bon moment. Je n’interviens que très peu dans votre journée, préférant\r\nles photos prises sur le vif. Lors des photos de famille, je serais là pour vous guider et vous indiquer quoi faire.\r\n<div class="paragraphe_FG">\r\n<h2>Un style unique</h2>\r\nJ’immortalise tous les moments importants du baptême de votre enfant, que ce soit\r\npour une cérémonie religieuse ou civile.\r\nRéaliser vos plus belles photos de famille dans un style qui m’est propre.\r\nGrâce à ma présence, vous construisez un héritage d’images très important\r\nque vous serez fier de transmettre à votre enfant. Je réalise des dizaines\r\nde reportages de baptême dans l’aisne et à Paris chaque année.\r\n<div class="paragraphe_FG">\r\n<h2>Conservez l’histoire de son baptême</h2>\r\nUn livre photo qui retrace cette journée unique avec vos photos préférées.\r\nGrâce à ce livre, votre enfant pourra revivre à nouveau son baptême.\r\nConservez ce livre qui se transmet de génération en génération grâce\r\nà sa qualité exceptionnelle et ses pages épaisses.\r\n\r\n<a href="#">Tarifs</a>\r\n\r\n<a href="#">Carte Cadeau</a>\r\n\r\n<a href="#">En savoir +</a>\r\n\r\n<img class="alignnone size-medium wp-image-29" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" widt