	(118, 1, '2022-12-14 15:17:50', '2022-12-14 14:17:50', '<h4 class="titre_prestation">GROSSESSE</h4>\n<h5 class="soustitre_prestation">Je suis à chaque fois très touchée\nqu’une future maman m’accorde sa confiance</h5>\n<article>\n<div class="paragraphe_FG">\n\n<span class="Lettrine">C</span>a y est la bonne nouvelle est arrivée, vous allez devenir bientôt maman.\nVous allez au fil des mois, commencer à sentir ce petit être grandir dans votre ventre, vous allez le câliner, lui parler, le rassurer et l’aimer un peu plus chaque jours jusqu’à enfin pouvoir le/la tenir dans vos bras et l’admirer\nOffrez-vous une jolie séance photo Grossesse pour immortaliser votre ventre tout rond.\nUne séance photo Maternité, c’est se souvenir de ses jolies formes.\n\n</div>\n</article><article>\n<div class="imageFlottanteDroite"><img class="shootGross1 size-medium wp-image-120" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/grossesse01-300x225.jpg" alt="Shooting grossesse n°1" width="300" height="225" /></div>\n<div class="paragraphe_FG">\n<h3>Qui a t’il de plus beau que donner la vie</h3>\nImmortaliser ce moment si important dans votre vie à vous mais aussi de votre couple.\nOffrez vous et offrez lui, de magnifiques souvenirs avant sa naissance, que vous pourrez revivre ensemble quand il/elle sera plus grand(e).\n<div class="imageFlottanteGauche"><img class="shootGross2 size-medium wp-image-121" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/grossesse02-300x219.jpg" alt="Shooting grossesse n°2" width="300" height="219" /></div>\n<div class="paragraphe_FG">\n<h3>Une séance photo toute seule, en couple, avec toute la famille</h3>\nDurant la séance photo, je fais des photos avec votre compagnon, un petit moment dans votre petite bulle d’amour\noù vous profiter de vous retrouver, de vous regarder, de vous dire des mots tout mignon, de vous serrer dans les bras …\nJe ferai également des photos de vous toute seule ainsi que des photos de la fratries s’il y a des frères et soeurs.\n<h3>Vivez une expérience unique</h3>\nLa maternité est une expérience extra-ordinaire… Neuf mois d’attente qu’il est important d’immortaliser dans le\nmoindre détail. De la chambre du bébé à votre main posée délicatement sur votre ventre rond, gardez un souvenir\nprécieux de cette aventure éphémère avant que bébé ne vienne chambouler votre vie.\n\nLe reportage maternité peut se dérouler chez vous, ou en extérieur si le temps le permet.\n\nGardez également de belles images des premiers instants de vie de votre bébé aux creux de vos bras et dans son nouveau cocon.\n\n</div>\n<div class="boutons"><a href="#">Tarifs</a></div>\n<div class="boutons"><a href="#">Carte Cadeau</a></div>\n<div class="boutons"><a href="#">En savoir +</a></div>\n</div>\n\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />\n\n</div>\n</div>\n</article>', 'Grossesse', '', 'inherit', 'closed', 'closed', '', '15-autosave-v1', '', '', '2022-12-14 15:17:50', '2022-12-14 14:17:50', '', 15, 'http://jmtriartstudiophoto.test/?p=118', 0, 'revision', '', 0),
