	(145, 1, '2022-12-16 14:20:48', '2022-12-16 13:20:48', 'Poser devant l’objectif du photographe, habillé, en lingerie ou nu, pour se voir sous un angle différent et amorcer un processus de réconciliation avec son corps. Maladie, rupture, deuil ou prise de poids : les raisons poussant à faire une séance de photo-thérapie sont nombreuses. \nC’est pour apaiser ce mal-être que ce shooting existe. Je vous propose 3 séances différentes pour vous aidez à accepter votre corps et améliorer l’estime de soi, vous aidez à vous aimer telles que vous êtes et à prendre conscience que vous n’avez pas a vous cacher. “En se mettant au centre de l’image, vous vous mettrez au centre de votre vie.”\n<blockquote>\n<img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Phototherapie1-199x300.jpg" alt="Shooting phototherapie n°1" width="199" height="300" />\n<h3>Entretiens personnalisés</h3>\nUn ou plusieurs entretiens personnalisés aura lieu au Studio avant chaque séance.» Des entretiens qui permettent d’en savoir plus sur vos antécédents, de cerner vos besoins et de créer un climat de confiance.\nDes séances de débriefings sont aussi au programme lors de la remise des photos.\nC’est justement cet accompagnement personnalisé qui a séduit Sophie :\n”Aujourd’hui, grâce à cette première séance photo (qui fut suivie de d’autres pour le plaisir), je souris à mon reflet dans le miroir, j’ai retrouvé une approche positive à mon visage et à mon corps. Cette séance photo m’a beaucoup aidée à me sentir mieux.”, note la Laonnoise, âgée de 50 ans, qui a choisie l’option «RenEssence», à la suite d’une prise de poids, divorce et perte d’un être cher. \n\n\nUne expérience thérapeutique libératrice qui serait difficilement réalisable dans d’autres conditions selon elle.\n</blockquote>\n\n<h3>Séance «RenEssence».</h3>\nLa séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous !\n\n<h3>Séance «Sur les courbes de mon corps».</h3>\nLa séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous !\n\n<div class="bouton">\n<div><a href="#">Carte Cadeau</a></div>\n<div><a href="#">Tarifs</a></div>\n<div><a href="#">En savoir +</a></div>\n</div>\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Photo-thérapie', '', 'inherit', 'closed', 'closed', '', '13-autosave-v1', '', '', '2022-12-16 14:20:48', '2022-12-16 13:20:48', '', 13, 'http://jmtriartstudiophoto.test/?p=145', 0, 'revision', '', 0),
