	(188, 1, '2022-12-16 12:55:40', '2022-12-16 11:55:40', 'Poser devant l’objectif du photographe, habillé, en lingerie ou nu, pour se voir sous un angle différent et amorcer\r\nun processus de réconciliation avec son corps. Maladie, rupture, deuil ou prise de poids : les raisons poussant à faire\r\nune séance de photo-thérapie sont nombreuses. C’est pour apaiser ce mal-être que ce shooting existe. Je vous propose 3 séances différentes pour vous aidez à accepter votre corps et améliorer l’estime de soi, vous aidez à vous aimer telles que vous êtes et à prendre conscience que vous n’avez pas a vous cacher. “En se mettant au centre de l’image, vous vous mettrez au centre de votre vie.” \r\n\r\n<blockquote><img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Bapteme01-300x200.jpg" alt="Shooting baptême n°1" width="300" height="200" />\r\n<h3>Entretiens personnalisés</h3>\r\nUn ou plusieurs entretiens personnalisés aura lieu au Studio avant\r\nchaque séance.» Des entretiens qui permettent d’en savoir plus sur\r\nvos antécédents, de cerner vos besoins et de créer un climat de confiance.\r\nDes séances de débriefings sont aussi au programme lors de la remise des photos.\r\nC’est justement cet accompagnement personnalisé qui a séduit Sophie :\r\n”Aujourd’hui, grâce à cette première séance photo (qui fut suivie de d’autres\r\npour le plaisir), je souris à mon reflet dans le miroir, j’ai retrouvé une approche\r\npositive à mon visage et à mon corps. Cette séance photo m’a beaucoup aidée\r\nà me sentir mieux.”, note la Laonnoise, âgée de 50 ans, qui a choisie l’option\r\n«RenEssence», à la suite d’une prise de poids, divorce et perte d’un être cher.\r\n\r\nUne expérience thérapeutique libératrice qui serait difficilement réalisable\r\ndans d’autres conditions selon elle. \r\n\r\n<img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Bapteme02-300x200.jpg" alt="Shooting baptême n°2" width="300" height="200" />\r\n<h3>Conservez l’histoire de son baptême</h3>\r\nUn livre photo qui retrace cette journée unique avec vos photos préférées.\r\nGrâce à ce livre, votre enfant pourra revivre à nouveau son baptême.\r\nConservez ce livre qui se transmet de génération en génération grâce à sa qualité exceptionnelle et ses pages épaisses.</blockquote>\r\n<div class="bouton">\r\n<div><a href="#">Carte Cadeau</a></div>\r\n<div><a href="#">Tarifs</a></div>\r\n<div><a href="#">En savoir +</a></div>\r\n</div>\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Baptême', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2022-12-16 12:55:40', '2022-12-16 11:55:40', '', 13, 'http://jmtriartstudiophoto.test/?p=188', 0, 'revision', '', 0),
	(189, 1, '2022-12-16 12:57:15', '2022-12-16 11:57:15', 'Poser devant l’objectif du photographe, habillé, en lingerie ou nu, pour se voir sous un angle différent et amorcer\r\nun processus de réconciliation avec son corps. Maladie, rupture, deuil ou prise de poids : les raisons poussant à faire\r\nune séance de photo-thérapie sont nombreuses. C’est pour apaiser ce mal-être que ce shooting existe. Je vous propose 3 séances différentes pour vous aidez à accepter votre corps et améliorer l’estime de soi, vous aidez à vous aimer telles que vous êtes et à prendre conscience que vous n’avez pas a vous cacher. “En se mettant au centre de l’image, vous vous mettrez au centre de votre vie.” \r\n\r\n<blockquote><img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Bapteme01-300x200.jpg" alt="Shooting baptême n°1" width="300" height="200" />\r\n<h3>Entretiens personnalisés</h3>\r\nUn ou plusieurs entretiens personnalisés aura lieu au Studio avant\r\nchaque séance.» Des entretiens qui permettent d’en savoir plus sur\r\nvos antécédents, de cerner vos besoins et de créer un climat de confiance.\r\nDes séances de débriefings sont aussi au programme lors de la remise des photos.\r\nC’est justement cet accompagnement personnalisé qui a séduit Sophie :\r\n”Aujourd’hui, grâce à cette première séance photo (qui fut suivie de d’autres\r\npour le plaisir), je souris à mon reflet dans le miroir, j’ai retrouvé une approche\r\npositive à mon visage et à mon corps. Cette séance photo m’a beaucoup aidée\r\nà me sentir mieux.”, note la Laonnoise, âgée de 50 ans, qui a choisie l’option\r\n«RenEssence», à la suite d’une prise de poids, divorce et perte d’un être cher.\r\n\r\nUne expérience thérapeutique libératrice qui serait difficilement réalisable\r\ndans d’autres conditions selon elle. \r\n\r\n<img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Bapteme02-300x200.jpg" alt="Shooting baptême n°2" width="300" height="200" />\r\n<h3>Séance «RenEssence».</h3>\r\nLa séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous ! \r\n<h3>Séance «Sur les courbes de mon corps».</h3>\r\nLa séance intitulée «Sur les courbes de mon corps» se déroule au domicile de la personne photographiée ou au studio et se concentre sur les parties qui vous complexent. \r\n<h3>Séance «Sens-U-Elle». </h3>\r\nL’option «Sens-U-Elle» propose de faire la séance habillée ou en sous-vêtements en Studio, tout au long de la séance, dans une ambiance bienveillante et décontractée, vous serez guidée et accompagnée. A l\'aide de jeux de lumière et de la gestuelle, je mets en avant votre personnalité, mon objectif est de sublimer votre beauté, tout en gardant votre naturel. Quand on est habillé, on se compare à un idéal de beauté et donc aux autres, du coup, on se concentre beaucoup plus sur un bourrelet, un ventre qui ressort dans une robe moulante, par exemple. Et puis, en sous-vêtements, on ne peut plus se cacher, on est vraiment soi !. Pour autant, se faire photographier en sous-vêtements, n’est pas facile pour tout le monde, cela s\'adresse davantage aux femmes qui, malgré leurs complexes, ont un minimum de confiance en elles, et généralement choisissent le plus souvent cette séance aprés les 2 autres précédemment citées.   \r\n\r\n</blockquote>\r\n<div class="bouton">\r\n<div><a href="#">Carte Cadeau</a></div>\r\n<div><a href="#">Tarifs</a></div>\r\n<div><a href="#">En savoir +</a></div>\r\n</div>\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Baptême', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2022-12-16 12:57:15', '2022-12-16 11:57:15', '', 13, 'http://jmtriartstudiophoto.test/?p=189', 0, 'revision', '', 0),
