	(201, 1, '2022-12-16 13:05:27', '2022-12-16 12:05:27', 'Au-delà des moments clés du baptême, ce qui fait que mon style est unique c’est ma facilité à capturer des moments de vie spontanés grâce à ma discrétion : La joie des retrouvailles, l’émotion d’un geste tendre, la beauté d’un détail, les enfants qui jouent…\r\n\r\nJe sais aussi qu’organiser un baptême est le moment idéal pour réunir toute votre famille et les personnes qui vous sont chères.\r\nJe fais donc en sorte que vous passiez un très bon moment.\r\nJe n’interviens que très peu dans votre journée, préférant les photos prises sur le vif.\r\nLors des photos de famille, je serais là pour vous guider et vous indiquer quoi faire.<br>\r\n\r\n&nbsp;\r\n<blockquote><img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Bapteme01-300x200.jpg" alt="Shooting baptême n°1" width="300" height="200" />\r\n<h3>Un style unique</h3>\r\nJ’immortalise tous les moments importants du baptême\r\nde votre enfant, que ce soit pour une cérémonie religieuse\r\nou civile.\r\nRéaliser vos plus belles photos de famille dans un style\r\nqui m’est propre.\r\nGrâce à ma présence, vous construisez un héritage d’images\r\ntrès important que vous serez fier de transmettre à votre enfant.\r\nJe réalise des dizaines de reportages de baptême dans l\'Aisne\r\net à Paris chaque année.\r\n\r\n<img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Bapteme02-300x200.jpg" alt="Shooting baptême n°2" width="300" height="200" />\r\n<h3>Conservez l’histoire de son baptême</h3>\r\nUn livre photo qui retrace cette journée unique\r\navec vos photos préférées.\r\nGrâce à ce livre, votre enfant pourra revivre à nouveau\r\nson baptême.\r\nConservez ce livre qui se transmet de génération\r\nen génération grâce à sa qualité exceptionnelle\r\net ses pages épaisses.</blockquote>\r\n<div class="bouton">\r\n<div><a href="#">Carte Cadeau</a></div>\r\n<div><a href="#">Tarifs</a></div>\r\n<div><a href="#">En savoir +</a></div>\r\n</div>\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Baptême', '', 'inherit', 'closed', 'closed', '', '186-revision-v1', '', '', '2022-12-16 13:05:27', '2022-12-16 12:05:27', '', 186, 'http://jmtriartstudiophoto.test/?p=201', 0, 'revision', '', 0),
