séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous ! \r\n<h3>Séance «Sur les courbes de mon corps».</h3>\r\nLa séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous ! \r\n\r\n</blockquote>\r\n<div class="bouton">\r\n<div><a href="#">Carte Cadeau</a></div>\r\n<div><a href="#">Tarifs</a></div>\r\n<div><a href="#">En savoir +</a></div>\r\n</div>\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Photo-thérapie', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2022-12-16 13:05:59', '2022-12-16 12:05:59', '', 13, 'http://jmtriartstudiophoto.test/?p=202', 0, 'revision', '', 0),
