aphier et à vous Aimer !! : Une séance rien que pour vous !\r\n\r\n<h3>Séance «Sur les courbes de mon corps».</h3>\r\nLa séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous !\r\n\r\n<div class="bouton">\r\n<div><a href="#">Carte Cadeau</a></div>\r\n<div><a href="#">Tarifs</a></div>\r\n<div><a href="#">En savoir +</a></div>\r\n</div>\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Photo-thérapie', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2022-12-16 14:17:02', '2022-12-16 13:17:02', '', 13, 'http://jmtriartstudiophoto.test/?p=217', 0, 'revision', '', 0),
	(218, 1, '2022-12-16 14:23:22', '2022-12-16 13:23:22', 'Poser devant l’objectif du photographe, habillé, en lingerie ou nu, pour se voir sous un angle différent et amorcer un processus de réconciliation avec son corps. Maladie, rupture, deuil ou prise de poids : les raisons poussant à faire une séance de photo-thérapie sont nombreuses. \r\nC’est pour apaiser ce mal-être que ce shooting existe. Je vous propose 3 séances différentes pour vous aidez à accepter votre corps et améliorer l’estime de soi, vous aidez à vous aimer telles que vous êtes et à prendre conscience que vous n’avez pas a vous cacher. “En se mettant au centre de l’image, vous vous mettrez au centre de votre vie.”\r\n<blockquote>\r\n<img src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/Phototherapie1-199x300.jpg" alt="Shooting phototherapie n°1" width="199" height="300" />\r\n<h3>Entretiens personnalisés</h3>\r\nUn ou plusieurs entretiens personnalisés aura lieu au Studio avant chaque séance.» Des entretiens qui permettent d’en savoir plus sur vos antécédents, de cerner vos besoins et de créer un climat de confiance.\r\nDes séances de débriefings sont aussi au programme lors de la remise des photos.\r\nC’est justement cet accompagnement personnalisé qui a séduit Sophie :\r\n”Aujourd’hui, grâce à cette première séance photo (qui fut suivie de d’autres pour le plaisir), je souris à mon reflet dans le miroir, j’ai retrouvé une approche positive à mon visage et à mon corps. Cette séance photo m’a beaucoup aidée à me sentir mieux.”, note la Laonnoise, âgée de 50 ans, qui a choisie l’option «RenEssence», à la suite d’une prise de poids, divorce et perte d’un être cher. \r\n\r\n\r\nUne expérience thérapeutique libératrice qui serait difficilement réalisable dans d’autres conditions selon elle.\r\n</blockquote>\r\n\r\n<h3>Séance «RenEssence».</h3>\r\nLa séance intitulée «RenEssence» se déroule au studio. Habillée de vos vêtements préférer, vous serez prête à vous [RE]-Découvrir, vous faire photographier et à vous Aimer !! : Une séance rien que pour vous !\r\n\r\n<h3>Séance «Sur les courbes de mon corps».</h3>\r\nLa séance intitulée «Sur les courbes de mon corps» se déroule au domicile de la personne photographiée ou au studio et se concentre sur les parties qui vous complexent.\r\n\r\n<h3>Séance «Sens-U-Elle».</h3>\r\nL’option «Sens-U-Elle» propose de faire la séance habillée ou en sous-vêtements en Studio, tout au long de la séance, dans une ambiance bienveillante et décontractée, vous serez guidée et accompagnée. A l\'aide de jeux de lumière et de la gestuelle, je mets en avant votre personnalité, mon objectif est de sublimer votre beauté, tout en gardant votre naturel. Quand on est habillé, on se compare à un idéal de beauté et donc aux autres, du coup, on se concentre beaucoup plus sur un bourrelet, un ventre qui ressort dans une robe moulante, par exemple. Et puis, en sous-vêtements, on ne peut plus se cacher, on est vraiment soi !. Pour autant, se faire photographier en sous-vêtements, n’est pas facile pour tout le monde, cela s\'adresse davantage aux femmes qui, malgré leurs complexes, ont un minimum de confiance en elles, et généralement choisissent le plus souvent cette séance aprés les 2 autres précédemment citées. \r\n\r\n<div class="bouton">\r\n<div><a href="#">Carte Cadeau</a></div>\r\n<div><a href="#">Tarifs</a></div>\r\n<div><a href="#">En savoir +</a></div>\r\n</div>\r\n<img class="fee wp-image-29 size-medium" src="http://jmtriartstudiophoto.test/wp-content/uploads/2022/12/fee-250x300.png" alt="Mascotte officielle JM Triart Studio Photo" width="250" height="300" />', 'Photo-thérapie', '', 'inherit', 'closed', 'closed', '', '13-revision-v1', '', '', '2022-12-16 14:23:22', '2022-12-16 13:23:22', '', 13, 'http://jmtriartstudiophoto.test/?p=218', 0, 'revision', '', 0),
